import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import React, { Component } from "react";

class Contact extends Component {
    render() {
        return (
            <div>
                <h2>CONTACT ME</h2>
                <ul>
                <li> <a href="https://www.linkedin.com/in/anthony-frazier-73b561202/"> <FontAwesomeIcon icon="fa-brands fa-linkedin"/> </a> </li>
                <li> <a href="https://www.linkedin.com/in/anthony-frazier-73b561202/"> <FontAwesomeIcon icon="fa-brands fa-square-github" /> </a> </li>
                </ul>
            </div>
        );
    }
}

export default Contact;
